script: |
  super -f text -I q6934.spq | sort > q6934.out

inputs:
  - name: q6934.spq
    data: |
      SELECT DISTINCT - 34 / cor1.col1 AS col0 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q6934.out
    data: |
      -1
      -2
      -3
